import React from 'react';
import Navbar from './components/layout/Navbar'
import Footer from './components/layout/Footer';
import Form from './components/contact/form';

function App() {
  return (
      <div className="App">
        <Navbar />
        <Form />
        <Footer />
      </div>
  );
}

export default App;
